import IncomeShow from "./IncomeShow"

function IncomePageList ({transactions})  {
  return (
    <div>
      {
        transactions.map((transaction)=>{
          return (
            <IncomeShow transaction={transaction}/>
          )
        })}
    </div>
  )
}

export default IncomePageList
